import React,{Component} from 'react';
import "./Skills.css"
import ProgressBar from '../ProgressBar/ProgressBar';
class Skills extends Component{
    render(){

        return(
            <div id="skills-container" className="skills-container">
                <div className="skills-title">My Skills</div>
                <ProgressBar title={'C, Linux, OOP, Network, TCP/UDP'} color={'red'} level="expert" percent={90}/>
                <ProgressBar title={'Java , C++, Html, Css, JavaScript, Xml'} color={'green'} level="expert" percent={20}/>
                <ProgressBar title={'Android, Web Application'} color={'green'} level="expert" percent={20}/>


            </div>

        );
    }
}

export default Skills;
